import React from 'react';
import { FaUser } from 'react-icons/fa'; // Importe o ícone de usuário do React Icons
import { MdDynamicFeed } from 'react-icons/md'; // Importe o ícone de feed do React Icons
import { IoLogOut } from 'react-icons/io5'; // Importe o ícone de logout do React Icons
import { Link } from 'react-router-dom';
import LogoImage from '../assets/Logo Escrito 2 Branco PNG.png';
import '../styles/Header.css'; 

function Header() {
    return (
        <main>
            <nav className="menu-principal">
                <div className="menu-links">
                    <img src={LogoImage} alt="Logo" className="logteste" />
                    <div className="icon-container">
                        <FaUser className="icon-user" /> {/* Use o componente do ícone diretamente */}
                        <IoLogOut className="icon-logout" /> {/* Use o componente do ícone diretamente */}
                        <StyledLink to="/"><FaUserLarge /></StyledLink>
                        <StyledLink to="/feed"><MdDynamicFeed /></StyledLink>
            <StyledLink to="/login"><IoLogOut /></StyledLink>
                    </div>
                </div>
            </nav>
        </main>
    );
}

export default Header;
